import React from 'react';
import { Link } from 'react-router-dom';

import Button from '../Button/Button.jsx'
import HeartIcon from '../HeartIcon/HeartIcon.jsx';
import CommentIcon from '../CommentIcon/CommentIcon.jsx';
import ShareIcon from '../ShareIcon/ShareIcon.jsx';

import classes from './Post.module.css'

const Post = ({post, ...props}) => {

    const { text, images } = post;

    return (
        <div className={classes.mainContainer}>
            <div className={classes.postHeader}>
                <div className={classes.postHeader__leftPart}>
                    <div className={classes.profilePictureContainer}>
                        <Link href="">
                            <img src={props.profilePictureLink} className={classes.profilePictureImage} alt="" />
                        </Link>
                    </div>
                    <div className={classes.profileName}>
                        <Link href={props.profileLink} className={classes.profileLink}>JLGDSNlsf</Link>
                    </div>
                </div>
                <div className={classes.postHeader__rightPart}>
                    <Button>Подписаться</Button>
                </div>
            </div>
            <div className={classes.contentContainer}>
                <div className={classes.images}>
                    {images.map((image, index) => (
                        <img
                            key={index}
                            src={image}
                            className={classes.image}
                        />
                    ))}
                </div>
                {text && <p className={classes.text}>{text}</p>}
            </div>
            <div className={classes.postFooter}>
                <div className={classes.postFooter__leftPart}>
                    <HeartIcon/>
                    <CommentIcon/>
                    <ShareIcon/>
                </div>
            </div>
        </div>
    );
};

export default Post;
